import React from "react";

const FaceRecognition = ({imageUrl}) => {
    return(  
        <div className="center">
            <img src={imageUrl} alt="" style={{width:'auto', height: 'auto'}} className= 'shadow-3 mt2'/>
        </div>  
    );
}

export default FaceRecognition;
